  <script id="bubbleMarks">
    const BubbleMarks = (selection, props) => {
      const {
        worldAtlas: {land, interiors },
        migrants, 
        sizeScale,
        sizeValue
      } = props;           
    
      const { geoNaturalEarth1, geoPath, geoGraticule } = d3;
      const projection = geoNaturalEarth1()
        .scale(window.innerWidth / 2.5 / Math.PI)
        .rotate([0, 0])
        .center([0, window.innerWidth > 1813 ? -25 : -32])
        .translate([window.innerWidth / 2, window.innerHeight / 2])
      ; 
      const path = geoPath(projection);
      const graticule = geoGraticule();

      const groups = selection
          .selectAll('g')
          .data(land.features);

      const groupsEnter = groups
        .enter()
        .append('g')
          .attr('class', 'marks')
      ;

      groupsEnter
        .merge(groups)
        .append('path')
          .attr('class', 'pSphere')
          .attr('d', path({ type: 'Sphere' }))
      ;

      groupsEnter
        .merge(groups)
        .append('path')
          .attr('class', 'pGraticules')
          .attr('d', path(graticule()))
      ;
          
      groups.exit().remove();
      
      groupsEnter
        .data(land.features)
        .append('path')
          .attr('class', 'pLand')
          .attr('d', d => path(d))
        .merge(groups.select('path'))
      ;
      
      groupsEnter
        .append('path')
          .attr('class', 'pInteriors')
          .attr('d', path(interiors))
        .merge(groups.select('path'))
      ;
      
      groupsEnter
        .selectAll('circle')
        .data(migrants)
        .enter()
        .append('circle')
          .attr('cx', d => ([x, y] = projection(d.coords), x))
          .attr('cy', d =>  ([x, y] = projection(d.coords), y))
          .attr('r', d => sizeScale(sizeValue(d)))
        .merge(groups.select('circle'))
      ;
    };

    globalThis.BubbleMarks = BubbleMarks;
  </script>
  <script id="bubbleMap">
    const { scaleSqrt, max } = d3;

    let sizeScale;

    const BubbleMap = (selection, props) => {
      const { migrants, filteredData, worldAtlas } = props;
      const sizeValue = d => d['Total Dead and Missing'];
      const maxRadius = 15;

      if(!sizeScale) {
        sizeScale = scaleSqrt()
          .domain([0, max(migrants, sizeValue)])
          .range([0, maxRadius]);
      }     

      selection
          .append('g')
            .call(
              BubbleMarks, 
              { 
                worldAtlas,
                migrants: filteredData,
                sizeScale,
                sizeValue,
              }
            ); 
    };
  </script>
  <script id="axisBottom">
    const AxisBottom = (selection, props) => {
      const {xScale, innerHeight, tickFormat, tickOffset} = props;

      selection
        .select('.multi')
        .selectAll('.bottomTick')
        .data(xScale.ticks())
        .enter()
        .append('g')
          .attr('transform', d => `translate(${xScale(d)}, 0)`)
          .attr('class', 'bottomTick')
        .append('line')
          .attr('y2', innerHeight)
        .select(function () { return this.parentNode; })
        .append('text')
          .attr('dy', '0.71em')
          .attr('y', innerHeight + (tickOffset ? tickOffset : 3))
          .attr('style', 'text-anchor: middle;')
          .text(d => tickFormat(d))
      ;
    }
  </script>
  <script id="axisLeft">
    const AxisLeft = (selection, props) => {
      const {yScale, innerWidth, tickOffset} = props;
      selection
        .select('.multi')
        .selectAll('.leftTick')
        .data(yScale.ticks())
        .enter()
        .append('g')
          .attr('transform', d => `translate(0, ${yScale(d)})`)
          .attr('class', 'leftTick')
        .append('line')
          .attr('x2', innerWidth)
        .select(function () { return this.parentNode; })
        .append('text')
          .attr('dy', '0.32em')
          .attr('x', -(tickOffset ? tickOffset : 3))
          .attr('style', 'text-anchor: end;')
          .text(d => d)
      ;
    }
  </script>
  <script id="histogramMarks">
    const HistogramMarks = (selection, props) => {
      const { binnedData, xScale, yScale, tooltipFormat, innerHeight, barOffset } = props;

      selection
        .select('.multi')
        .selectAll('histoMark')
        .data(binnedData)
        .enter()
        .append('rect')
          .attr('x', d => xScale(d.x0))
          .attr('y', d => yScale(d.y))
          .attr('width', d => xScale(d.x1) - xScale(d.x0) - barOffset)
          .attr('height', d => innerHeight - yScale(d.y))
          .attr('class', 'histoMark')
        .append('title')
          .text(d => tooltipFormat(d.y))
      ;
    }
  </script>
  <script id="dateHistogram">
    const { 
      scaleTime, scaleLinear, timeFormat, extent, bin, timeMonths, sum,  
      format, brushX, select 
    } = d3;

    const margin = { top: 0, right: 30, bottom: 5, left: 60 };
    const xAxisLabelOffset = 50;
    const yAxisLabelOffset = 30;
    const tickOffset = 10;
    const barOffset = 3;
    const xAxisTickFormat = timeFormat('%b-%Y');
    const tooltipFormat = format(',');
    let xScale;
    let yScale;
    let binnedData;

    const DateHistogram = (selection, props) => {
      const {migrants, width, height, setBrushExtent, xValue} = props;

      const innerHeight = height - margin.top - margin.bottom;
      const innerWidth = width - margin.left - margin.right;

      const xAxisLabel = 'Reported Date';

      const yValue = d => d['Total Dead and Missing'];
      const yAxisLabel = 'Total Dead and Missing';

      let idx = 0;

      if (!xScale) {
        xScale = scaleTime()
          .domain(extent(migrants, xValue))
          .range([0, innerWidth])
          .nice();
      }

      const [start, stop] = xScale.domain();

      if(!binnedData){
        binnedData = bin()
          .value(xValue)
          .domain(xScale.domain())
          .thresholds(timeMonths(start, stop))
          (migrants)
          .map(array => ({
            y: sum(array, yValue),
            x0: array.x0,
            x1: array.x1
          }));
      }

      if(!yScale){
        yScale = scaleLinear()
          .domain([0, max(binnedData, d => d.y)])
          .range([innerHeight, 0]);
      }

      const group = selection
          .append('g');

      const groupEnter = group
        .enter()
        .append('g')
      ;

      groupEnter
        .merge(group)
        .append('rect')
          .attr('width', width)
          .attr('height', height)
          .attr('class', 'bgWhite')
      ;

      groupEnter
        .merge(group)
        .append('g')
          .attr('transform', `translate(${margin.left}, ${margin.top})`)
          .attr('class', 'multi')
      ;

      groupEnter
        .merge(group)
        .call(
          AxisBottom,
          {
            xScale,
            innerHeight,
            tickFormat: xAxisTickFormat,
            tickOffset
          }
        )
      ;

      groupEnter
        .merge(group)
        .call(
          AxisLeft,
          {
            yScale,
            innerWidth,
            tickOffset
          }
        )
      ;

      groupEnter
        .merge(group)
        .append('text')
          .attr('x', innerWidth / 2)
          .attr('y', innerHeight + xAxisLabelOffset)
          .attr('style', 'text-anchor: middle;')
          .attr('class', 'axis-label-multi')
          .text(xAxisLabel)
      ;

      groupEnter
        .merge(group)
        .append('text')
          .attr('transform', `translate(${yAxisLabelOffset - 10}, ${innerHeight / 2}) rotate(-90)`)
          .attr('style', 'text-anchor: middle;')
          .attr('class', 'axis-label-multi')
          .text(yAxisLabel)
      ;

      groupEnter
        .merge(group)
        .call(
          HistogramMarks,
          {
            binnedData,
            xScale,
            yScale,
            tooltipFormat,
            innerHeight,
            barOffset
          }
        )
      ;
          
      group.exit().remove();

      selection
        .append('g')
        .attr('id', 'brushRef')
      ;

      select('#brushRef')
        .call(
          brushX().extent([[margin.left, 0], [innerWidth + margin.left, innerHeight]])
            .on('brush end', (event, d) => {
              const selection = event.selection && [
                event.selection[0] - margin.left, 
                event.selection[1] - margin.left
              ];
              if(event.type === 'end' || idx > 3) {
                idx = 0
                setBrushExtent(selection && selection.map(xScale.invert));
              } else {
                idx++
              }
            })
        )
      ;
    }
  </script>
  <style>
    body {
      margin: 0;
      overflow: hidden;
      font-family: Arial, Helvetica, sans-serif;
    }
    .tick line {
      stroke: #C0C0BB;
    }
    .tick text {
      fill: #635F5D;
    }
    .marks circle {
      fill: #137b80;
      opacity: 0.3;
    }
    .axis-label {
      font-size: 1.3em;
      fill: #635F5D;
    }
    circle, rect {
      fill: #137b80;
    }
    .marks .pLand {
      fill: #ececec;
    }
    .marks .pSphere {
      fill: #fbfbfb;
    }
    .marks .pInteriors {
      fill: none;
      stroke: #d9dfe0;
    }
    .marks .pGraticules, .multi .leftTick line, .multi .bottomTick line {
      fill: none; 
      stroke: #ececec;
    }
    .axis-label-multi {
      font-size: 0.5em;
    }
    .multi .leftTick text, .multi .bottomTick text { 
      font-size: 0.5em;
    }
    .bgWhite {
      fill: white;
    }
    #brushRef .overlay {
      fill: none;
    }
    .handle {
      fill: none;
    }
  </style>
</head>
<body>
  <div id="root"></div>
  <script id="App" defer>
    (async () => {
      const { select } = d3;
      
      const margin = { top: 30, left: 10}
      const defaults = {width: window.innerWidth - margin.left, height: window.innerHeight - margin.top};
      const width = window.innerWidth - margin.left;
      const height = window.innerHeight - margin.top;
      const dateHistogramSize = 0.2;
      const xValue = d => d['Reported Date'];
      let brushExtent;

      const setBrushExtent = (data) => {
          brushExtent = data;
          svg
            .select('#bubble-container')
            .select('#bubble-map')
            .remove()
          ;
          svg
            .select('#bubble-container')
              .append('g')
                .attr('id', 'bubble-map')
                .call(
                  BubbleMap, 
                  { 
                    migrants: sourceData,
                    filteredData: brushExtent ? sourceData.filter(d => {
                      const date = xValue(d);
                      return date > data[0] && date < data[1];
                    }) : sourceData,
                    worldAtlas: useWorldAtlas()
                  }
          );  
      }

      const render = data => {
        svg
          .append('g')
            .attr('id', 'bubble-container')
          .append('g')
            .attr('id', 'bubble-map')
            .call(
              BubbleMap, 
              { 
                migrants: sourceData,
                filteredData: sourceData,
                worldAtlas: useWorldAtlas()
              }
            ); 
        svg
          .append('g')
            .attr('transform', `translate(0, ${height - (dateHistogramSize * height)})`)
            .call(
              DateHistogram, 
              { 
                migrants: sourceData,
                width,
                height: dateHistogramSize * height,
                setBrushExtent,
                xValue
              }
            ); 
      };
      const svg = select('#root')
        .append('svg')
          .attr('width', width)
          .attr('height', height)
          .attr('viewbox', `0 0 ${width} ${height}`);    
          
      const formatData = d => {
        d['Total Dead and Missing'] = +d['Total Dead and Missing'];
        d['Reported Date'] = new Date(d['Reported Date']);
        d.coords = d['Location Coordinates'].split(',').map(d => +d).reverse();
      };

      sourceData.forEach(formatData);
      sourceData.columns = Object.keys(sourceData[0]);
      render(sourceData);
    })();
  </script>
